import React from "react";
import { Button } from "../Button";
import "./About.css";
import "../../App.css";

function About() {
  return (
    <div className="about-container">
      <div className="about-header">
        <h2>Engineer</h2>
        <h2>Web Developer</h2>
        <h2>Photographer</h2>
      </div>
      <div className="about-me">
        <h3>About Me</h3>
        <p>i am a big booty guy</p>
      </div>
    </div>
  );
}

export default About;
